import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import IssueIcon from '@material-ui/icons/Error';
import CommentIcon from '@material-ui/icons/Comment';
import Paper from '@material-ui/core/Paper';

const styles = theme => ({
  root: {
    width: '100%',
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  },
});

class InsetList extends React.Component {
  render() {
    return (
      <div>
        <Paper className='RepoPageIssuesPaper' elevation={0}>
          <List component="nav">
            {this.props.issues!==false && this.props.issues!==undefined && this.props.issues.map((n,index) => {
              return (
                <ListItem button onClick={()=>this.props.handleIssue(n._id)}>
                  <ListItemIcon>
                    <IssueIcon />
                  </ListItemIcon>
                  <ListItemText inset primary={n.title} secondary={`#${index} asked by ${n.creator} on ${n.created}`} />
                  <ListItemIcon>
                    <CommentIcon />
                  </ListItemIcon>
                  <p style={{color:"grey"}}># coming soon</p>
                </ListItem>
              );
            })}
          </List>
        </Paper>
      </div>
    );
  }
}

InsetList.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(InsetList);
